import './Page.css'
import React from 'react';
import Avatar from '@material-ui/core/Avatar'
import {Button} from 'react-bootstrap'
import image from './elon.jpg'
 const  Page = ({name}) => {
        return (
        <div className='page'>
            <div className='avatar'>
              <Avatar  alt="elon"  src={image} />
            </div>
            <div className='name'>
              <p>{name}</p>
            </div>
           <div className='button'>
                <Button
                variant='outlined'>CONNECT TO PAGE</Button>
        </div> 
        </div>
    );
   }

   export default Page;
